import React from 'react';

const ScorecardTab = ({ match }) => {
  const { scoreboards = [], batting = [], bowling = [], localteam, visitorteam } = match;

  if (!scoreboards.length || !batting.length) {
    return <div>Scorecard not available.</div>;
  }

  const getInningTitle = (scoreboardKey) => {
    const team = scoreboards.find(sb => sb.scoreboard === scoreboardKey)?.team_id;
    if (team === localteam?.id) return `${localteam.name} Innings`;
    if (team === visitorteam?.id) return `${visitorteam.name} Innings`;
    return `${scoreboardKey} Innings`;
  };

  const groupBattingByInnings = () => {
    const inningsMap = {};
    batting.forEach(bat => {
      if (!inningsMap[bat.scoreboard]) inningsMap[bat.scoreboard] = [];
      inningsMap[bat.scoreboard].push(bat);
    });
    return inningsMap;
  };

  const groupBowlingByInnings = () => {
    const inningsMap = {};
    bowling.forEach(bowl => {
      if (!inningsMap[bowl.scoreboard]) inningsMap[bowl.scoreboard] = [];
      inningsMap[bowl.scoreboard].push(bowl);
    });
    return inningsMap;
  };

  const battingInnings = groupBattingByInnings();
  const bowlingInnings = groupBowlingByInnings();

  return (
    <div className="scorecard-tab">
      {Object.keys(battingInnings).map((inningKey) => (
        <div key={inningKey} className="innings">
          <h3>{getInningTitle(inningKey)}</h3>
          <h4>Batting</h4>
          <table>
            <thead>
              <tr>
                <th>Batsman</th>
                <th>R</th>
                <th>B</th>
                <th>4s</th>
                <th>6s</th>
                <th>SR</th>
                <th>How Out</th>
              </tr>
            </thead>
            <tbody>
              {battingInnings[inningKey].map((bat) => (
                <tr key={bat.id}>
                  <td>{bat.batsman?.fullname || bat.batsman?.display_name || 'Unknown'}</td>
                  <td>{bat.score}</td>
                  <td>{bat.ball}</td>
                  <td>{bat.four_x}</td>
                  <td>{bat.six_x}</td>
                  <td>{bat.rate}</td>
                  <td>{bat.result?.name || '—'}</td>
                </tr>
              ))}
            </tbody>
          </table>

          <h4>Bowling</h4>
          <table>
            <thead>
              <tr>
                <th>Bowler</th>
                <th>O</th>
                <th>M</th>
                <th>R</th>
                <th>W</th>
                <th>Econ</th>
              </tr>
            </thead>
            <tbody>
              {(bowlingInnings[inningKey] || []).map((bowl) => (
                <tr key={bowl.id}>
                  <td>{bowl.bowler?.fullname || bowl.bowler?.display_name || 'Unknown'}</td>
                  <td>{bowl.overs}</td>
                  <td>{bowl.medians}</td>
                  <td>{bowl.runs}</td>
                  <td>{bowl.wickets}</td>
                  <td>{bowl.rate}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
};

export default ScorecardTab;
